%%
clear all;clc;close all;

filename1 = fullfile('C:\Users\enqui\OneDrive\Documents\MATLAB\3rd year\Project\Face ID');
imds = imageDatastore('Face ID', 'LabelSource', 'foldernames', 'IncludeSubfolders',true);

%%
%Determining the point of the images and setting the size to 1000 points per
%image so it isn't time consuming.
%imds = imresize(imds,[1600 1200]);
bag = bagOfFeatures(imds,'VocabularySize',1000,'PointSelection','Detector');
imagefeatures = encode(bag,imds);

%%
%Putting the data points into a table and adding a column in the table with
%the names of each whether the image is a fall or not.
Facedata = array2table(imagefeatures);
Facedata.Labels = imds.Labels;   

%%
clc;close all;
[trainedClassifier, validationAccuracy] = trainClassifier(Facedata);

camera = webcam(1);
start = tic;
Start = tic;
Ollie = 0;
Liam = 0;
Abi = 0;
Benni = 0;
Ben = 0;


while true
    im = snapshot(camera); % Take a picture
    im = imresize(im,[1600 1200]); % Resize the picture for alexnet
    image(im);                   % Show the picture
    
    elapsedTime = toc(start);
    if elapsedTime > 1 
        imagefeatures = encode(bag,im);
        WebcamerFeatures = array2table(imagefeatures);
        [imagepredict,probabilities] = trainedClassifier.predictFcn(WebcamerFeatures);
       
        maxprobabilities = max(probabilities);
        labelStr = cellstr(imagepredict);
        textToDisplay = sprintf('Label : %s \nprobabilities :%f',labelStr{:},maxprobabilities)
        start = tic;
        
        if labelStr == "Ollie"
            Ollie = Ollie + 1;
            
            if Ollie == 5
                Alert = ('Ollie is detected')
                StartTime = toc(Start)
                Ollie = 0;
            
                if StartTime > 10
                   Start = tic;
                end
            end
        end 
        
        if labelStr == "Liam"
            Liam = Liam + 1;
            
            if Liam == 5
                Alert = ('Liam is detected')
                Liam = 0;
                StartTime = toc(Start)
            
                if StartTime > 10
                    Start = tic;
                end
            end
        end 
        
        if labelStr == "Abi"
            Abi = Abi + 1;
            
            if Abi == 5 
                Alert = ('Abi is detected')
                Abi = 0;
                StartTime = toc(Start)
            
                if StartTime > 10                
                   Start = tic;
                end
            end
        end 
            
        if labelStr == "Benni"
            Benni = Benni + 1;
            
            if Benni == 5
                Alert = ('Benni is detected')
                Benni = 0;
                StartTime = toc(Start)
            
                if StartTime > 10
                   Start = tic;
                end
            end
        end 
        
        if labelStr == "Ben"
            Ben = Ben + 1;
            
            if Ben == 5 
                Alert = ('Ben is detected')
                Ben = 0;
                StartTime = toc(Start)
            
                if StartTime > 10                  
                   Start = tic;
                end
            end
        end 
        
    end 
end

